import { StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#eff7f8',
    },

    body: {
        flex: 1,
        paddingTop: 50,
        paddingHorizontal: 18
    },
    
    header: {
        fontSize: 24,
        color:"#21a3d0",
        fontWeight: "bold"
    },

    ScrollItems: {
        marginTop: 25
      },
});

export default styles;
